import React from 'react';

function Footer() {
  return (
    <div>
      <h2>Contact Us</h2>
      <address>
        <p>
          Seb's Restaurant<br />
          123 Main St<br />
          Anytown, Canada 12345
        </p>
        <p>
          <strong>Phone:</strong>{' '}
          <a href="tel:555-555-1212" aria-label="Call Seb's Restaurant">(555) 555-1212</a><br />
          <strong>Email:</strong>{' '}
          <a href="mailto:info@sebsrestaurant.com" aria-label="Email Seb's Restaurant">info@sebsrestaurant.com</a>
        </p>
      </address>
    </div>
  );
}

export default Footer;
